  [],\n\t\"revision_timestamp\": \"2015-09-26T22:36:20.346497\",\n\t\"name\": \"2006-multibeam-mapping-of-along-shelf-corridor-between-madison-swanson-and-steamboat-lumps-flor\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This disk or set of disks contain high-resolution
  multibeam and backscatter maps of a long thin corridor at the shelf edge near he
  74-m isobath spanning from Madison-Swanson (29.1667N, 85.6667W) in the north to
  Steamboat (28.1667N, 84.6667W), in West-Florida shelf. It includes the following
  products: 1) ESRI .ASC files, 2) Text file containing X, Y, Z postprocessed bathymetry
  data, 3) Geotiff and JPEG images from of bathymetry, 4) GeoTiff and JPEG images
  of backscatter, and 5) Fledermaus files of the survey locations. All products are
  available contacting the distributor. Some data sets are also posted on NOAA's Coral
  Reef Information System (CoRIS) at www.coris.noaa.gov. Another product that will
  not be distributed, but will be used as input to habitat classification software
  (QTC MultiView), are raw data files logged to disk using the Simrad EM3000 multibeam
  system data acquisition software. These raw files contain packets of information
  (depth soundings, navigation, attitude, sound velocity profiles, UTC time) that
  the acquisition software logged sequentially in time. The raw data format is available
  from Kongsberg-Simrad. The multibeam system was provided by University of South
  Florida, College of Marine Science and the support vessel was the Florida Institute
  of Oceanography R/V Suncoaster.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
